プリウス(DAA-ZVW30)専用HIDキット6000K<BR><BR>
トヨタ プリウス(前期/後期)専用のパフォーマンスパッケージです。<br><br>
【製品特徴】<BR>
■特徴的なヘッドライトを装備するプリウスのロー側ヘッドライトのHID化はもちろん、フロントスモールランプバルブをセットしました。<br>
■同梱のインバータ・イグナイタ専用ステーを使用することでヘッドライトやバンパーを外すことなくHIDシステムの取り付けを可能としています。<br>
■商品構成は、ベロフアトラクションパワーユニットをベースに、HIDバルブを「スパーク・ホワイト」6000Kをセットにしました。<br>
■純正ハロゲンバルブより明るく、純正LEDヘッドライトでは不可能な発光色の変更が可能となります。<br>
■交換時バーナーのガラス部分には<BR>
　 触れないようにお願いします。<BR>
　 油分がつきますとバーナーの寿命が短くなる可能性がございます。<BR><br>
【商品内容】<BR>
・アトラクションパワーユニット(1セット)<BR>
・バルブキット(1セット)<br>
・インバーター・イグナイターステー(1式)<br>
・取付けハーネス(1式)<br>
・フロントクリアランスバルブLED(1セット)<br>
・取扱説明書(保証書)<BR><BR>
※LEDヘッドライト装着車両には装着できません。<br>
※受注生産の為、納品まで1週間前後お時間を頂き、
一度メーカーから取り寄せてからの出荷となります。<BR>
　お急ぎの方はご注文前に納期お問い合わせ下さい。<BR><BR><br>







